import React, { Fragment } from "react";
import { Provider } from "react-redux";
import GlobalStyles from "./styles/global";
import store from "./store";
import Routes from "./routes/index";

function App() {
  return (
    <>
      <Provider store={store}>
        <Fragment>
          <Routes />
          <GlobalStyles />
        </Fragment>
      </Provider>
    </>
  );
}

export default App;
